      for (const [key, value] of Object.entries(item)) {
        if (key === 'firstName' || key === 'lastName' || key === 'body') {
          values.push(value);
        }
      }
    }
    console.log(values.join(' '));
  } catch (error) {
    console.log('Signup system offline');
  }
}

